import React from 'react';

const Consumer=()=>{
    return(
        <>
        <div className="consumer-programs">
            <h2>OUR CONSUMER PROGRAMS</h2>
            <div className="program-logos">
                <img src="images/image 1.png" alt="Tiscon Golden Homes" className="program-logo" />
                <img src="images/image 2.png" alt="Consumer Champions" className="program-logo" />
                <img src="images/image 3.png" alt="Refer a Mate" className="program-logo" />
            </div>
        </div>
    
        

        </>
    )
}
export default Consumer;
